import React from 'react';
import { BrowserRouter as Router, Route } from "react-router-dom";

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <button>Start</button>
        </header>
      </div>
    );
  }
}

export default App;
